import React, { useState, useEffect } from "react";
import { Col, Row, Container } from "../components/Grid";
import "../utils/API"
import API from "../utils/API";



function Testing() {

    const [userList, setUserList] = useState([]);


    useEffect(() => {
        const getUsers = async () => {
            const users = await API.getAllUsers()
            setUserList(users)
        }
        getUsers();
    }, [])

    return (
        <Container fluid>
            <form type="input" onSubmit={API.saveUser()}>
                <input id="userNameInput" type="text" placeholder="Enter UserName"></input>
                <input id="passwordInput" type="text" placeholder="Enter Password"></input>
                <button type="submit">SAVE USER</button>
            </form>
            <button onClick={API.getAllUsers}>Get Users</button>
            <div className="container">
                <div id="tableWrapper" className="row">
                    <table className="table table-striped table-hover">
                        <thead>
                            <tr id="tableHeader" className="bg-warning">
                                <th scope="col">
                                    Name
                    </th>
                            </tr>
                        </thead>
                        <tbody>
                            {userList?.map((result, index) => {
                                return (
                                    <tr key={index}>
                                        <td>
                                            {result.userName}
                                        </td>
                                    </tr>
                                );
                            })}
                        </tbody>
                    </table>
                </div>
            </div>
        </Container>
    );
};

export default Testing;
